RC Hbm::MicronHbm2e::Setup()
{
    RC rc;

    CHECK_RC(Hbm2Interface::Setup()); // Adds vendor inpedendent WIRs

    // Support checks
    //
    if (m_HbmModel.vendor != Vendor::Micron)
    {
        Printf(Tee::PriError, "Attempt to setup Micron HBM2e interface with a "
               "non-Micron HBM model:\n\t%s\n",
               m_HbmModel.ToString().c_str());
        MASSERT(!"Attempt to setup Micron HBM2e interface with a non-Micron "
                "HBM model");
        return RC::SOFTWARE_ERROR;
    }

    if (m_HbmModel.spec != SpecVersion::V2e)
    {
        Printf(Tee::PriError, "Unsupported Micron HBM specification:\n  %s\n",
                m_HbmModel.ToString().c_str());
        MASSERT(!"Attempt to setup Micron interface with a unsupported HBM specification");
        return RC::UNSUPPORTED_FUNCTION;
    }

    CHECK_RC(AddWirs(s_MicronHbm2eWirs));

    SetupPprResponseTable();

    return rc;
}

