RC Hbm::MicronHbm2e::RowRepair
(
    const Settings& settings,
    const SiteRowErrorMap& siteRowErrorMap,
    RepairType repairType
) const
{
    RC rc;

    if (settings.modifiers.skipHbmFuseRepairCheck)
    {
        Printf(Tee::PriWarn, "Micron row repair does not support skipping "
               "the HBM fuse repair check. Continuing repair with check.\n");
    }

    const Wir* pWirRepair = nullptr;
    switch (repairType)
    {
        case RepairType::HARD:
            CHECK_RC(LookupWir(Wir::HARD_REPAIR, &pWirRepair));
            break;

        case RepairType::SOFT:
            CHECK_RC(LookupWir(Wir::SOFT_REPAIR, &pWirRepair));
            break;

        default:
            Printf(Tee::PriError, "Row repair: unsupported repair type");
            MASSERT(!"Row repair: unsupported repair type");
            return RC::SOFTWARE_ERROR;
    }
    MASSERT(pWirRepair);
    return DoRowRepair(settings, siteRowErrorMap, pWirRepair, repairType);
}

