/******************************************************************************/
// RunMBist
RC Hbm::MicronHbm2e::RunMBist() const
{
    StickyRC firstRc;

    firstRc = RunMbistRefresh1Pattern();
    firstRc = RunMbistRefresh2Pattern();
    firstRc = RunMbistFunctionalPattern();
    firstRc = RunMbistFmax0246Pattern();
    firstRc = RunMbistFmax1357Pattern();

    return firstRc;
}

RC Hbm::MicronHbm2e::DoRowRepair
(
    const Settings& settings,
    const SiteRowErrorMap& siteRowErrorMap,
    const Wir* pWirRepair,
    RepairType repairType
) const
{
    MASSERT(IsSetup());
    RC rc;

    GpuHbmInterface* pGpuIntf = GpuInterface();
    MASSERT(pGpuIntf);

    const Wir* pWirWsoMux = nullptr;
    CHECK_RC(LookupWir(Wir::WSO_MUX, &pWirWsoMux));
    MASSERT(pWirWsoMux);

    const Wir* pWirPprInfo = nullptr;
    CHECK_RC(LookupWir(Wir::PPR_INFO, &pWirPprInfo));
    MASSERT(pWirPprInfo);

    StickyRC firstRepairRc;
    for (const auto& siteRowErrors : siteRowErrorMap)
    {
        const Site hbmSite = siteRowErrors.first;

        // Enable additional hard repair resources for Micron HBM2E
        CHECK_RC(UnlockSpareRows(hbmSite));

        for (const RowErrorInfo& rowErrInfo : siteRowErrors.second)
        {
            const RowError& rowErr      = rowErrInfo.error;
            const HbmChannel hbmChannel = rowErrInfo.hbmChan;
            const Row& row              = rowErr.row;
            Dword baseDword((row.pseudoChannel.Number() ? 2 : 0));

            for (UINT08 loop = 0; loop < s_NumDwordsPerRepair; ++loop)
            {
                Dword dword(baseDword.Number() + loop);
                ROW_REPAIR_FIRST_RC_SKIP(PreSingleRowRepair(hbmSite, hbmChannel, rowErr));

                RowRepairWriteData repairData(Stack(row.rank), row.bank, row, dword);
                {
                    Printf(Tee::PriNormal,
                            "[repair] \tRepair type: %s\n"
                            "[repair] \tGPU location: HW FBPA %u, subpartition %u\n"
                            "[repair] \tHBM location: site %u, stack %u, channel %u, bank %u, "
                            "row %u, dword %u\n"
                            "[repair] \tInterface: IEEE1500\n"
                            "[repair] \tskip_hbm_fuse_repair_check: %s (ignored)\n"
                            "[repair] \tpseudo_hard_repair: %s\n",
                            Memory::ToString(repairType).c_str(),
                            row.hwFbio.Number(), row.subpartition.Number(),
                            hbmSite.Number(), row.rank.Number(), hbmChannel.Number(),
                            row.bank.Number(), row.row, dword.Number(),
                            Utility::ToString(settings.modifiers.skipHbmFuseRepairCheck).c_str(),
                            Utility::ToString(settings.modifiers.pseudoHardRepair).c_str());
                }

                if (!settings.modifiers.pseudoHardRepair)
                {
                    // Grab the IEEE1500 mutex
                    std::unique_ptr<PmgrMutexHolder> pPmgrMutex;
                    ROW_REPAIR_FIRST_RC_SKIP(pGpuIntf->AcquirePmgrMutex(&pPmgrMutex));

                    ROW_REPAIR_FIRST_RC_SKIP(pGpuIntf->WirWrite(*pWirRepair, hbmSite,
                            hbmChannel, repairData));

                    pGpuIntf->SleepMs(1100); // sleep after each HARD_REPAIR WDR write

                    UINT32 wsoMuxChan = 0;
                    auto it = s_PprResponseTable.find(
                        {
                            hbmChannel,
                            static_cast<UINT08>(dword.Number()),
                            Stack(row.rank)
                        }
                    );
                    if (it != s_PprResponseTable.end())
                    {
                        wsoMuxChan = it->second;
                    }
                    else
                    {
                        Printf(Tee::PriError,
                                "PPR table lookup failed for channel = %u, "
                                "DWORD = %u, Site = %u\n",
                                hbmChannel.Number(), dword.Number(), hbmSite.Number());
                        return RC::SOFTWARE_ERROR;
                    }

                    // Confirm the repair happened
                    //

                    // WSO_MUX programming with 0 mode and 0 data
                    // This is Micron specific sequence.
                    // The WSO Mux Register can be used to remap WSO outputs,
                    // Which gives correct PPR_RESPONSE
                    // WSO : IEEE1500 Wrapper serial port data out
                    ROW_REPAIR_FIRST_RC_SKIP(pGpuIntf->WirWriteRaw(*pWirWsoMux, hbmSite,
                            HbmChannel(wsoMuxChan)));
                    ROW_REPAIR_FIRST_RC_SKIP(pGpuIntf->ModeWriteRaw(*pWirWsoMux, hbmSite));
                    ROW_REPAIR_FIRST_RC_SKIP(pGpuIntf->WdrWriteRaw(hbmSite,
                            HbmChannel(wsoMuxChan),
                            WdrData({ 0 })));

                    // PPR Information read
                    PprInfoReadData postRepairPprInfoData;
                    ROW_REPAIR_FIRST_RC_SKIP(pGpuIntf->WirRead(*pWirPprInfo, hbmSite,
                            hbmChannel,
                            &postRepairPprInfoData));
                    if (!postRepairPprInfoData.IsPprResponseSuccess())
                    {
                        Printf(Tee::PriError, "Row %s Repair failed. All spare rows might "
                                "exhausted for the given bank!\n", row.rowName.c_str());
                        ROW_REPAIR_FIRST_RC_SKIP(RC::BAD_HBM_FUSE_DATA);
                        break;
                    }
                    // Final step, record repair metadata
                    //
                    firstRepairRc = PostSingleRowRepair(settings, repairType, rowErr, hbmSite,
                            hbmChannel, RC::OK);
                }
            }
        }
    }

    return firstRepairRc;
}

RC Hbm::MicronHbm2e::UnlockSpareRows(const Site &hbmSite) const
{
    RC rc;

    CHECK_RC(UnlockSpareRowsSequence(hbmSite, HbmChannel(0), 0xea, 0, 0));
    CHECK_RC(UnlockSpareRowsSequence(hbmSite, HbmChannel(0), 0xaa, 0, 0));
    CHECK_RC(UnlockSpareRowsSequence(hbmSite, HbmChannel(0), 0xee, 0, 0));
    CHECK_RC(UnlockSpareRowsSequence(hbmSite, HbmChannel(0), 0xd3, 0, 0));
    CHECK_RC(UnlockSpareRowsSequence(hbmSite, HbmChannel(0), 0xa0, 0xF, 0x000047C1));

    return rc;
}
/******************************************************************************/
// RowRepairWriteData
Hbm::MicronHbm2e::RowRepairWriteData::RowRepairWriteData
(
    Stack stack,
    Bank bank,
    Row row,
    Dword dword
)
{
    using namespace Utility;

    MASSERT(m_Data.empty());
    m_Data.push_back(0);
    UINT32& data = m_Data.back();

    // set repair vector valid bit
    data |= 1;

    AssertWithinBitWidth(stack.Number(), 1, "stack ID");
    data |= stack.Number() << 1;

    AssertWithinBitWidth(stack.Number(), 4, "bank");
    data |= bank.Number() << 2;

    AssertWithinBitWidth(dword.Number(), 2, "DWORD");
    m_Data.back() |= dword.Number() << 6;

    AssertWithinBitWidth(row.row, 15, "row address");
    data |= row.row << 8;
}

/******************************************************************************/
// PprInfoReadData

bool Hbm::MicronHbm2e::PprInfoReadData::IsPprResponseSuccess() const
{
    const UINT32 data = m_Data.front();

    Printf(Tee::PriDebug, "[Repair] PPR response data : 0x%x, response size : %lu\n",
            data, m_Data.size());

    return (data ? false : true);
}

/******************************************************************************/
// UnlockSpareRowsSequence

RC Hbm::MicronHbm2e::UnlockSpareRowsSequence
(
    const Site &hbmSite,
    const Channel& hbmChannel,
    UINT08 instr,
    UINT32 wdrLength,
    UINT32 data
) const
{
    RC rc;

    GpuHbmInterface* pGpuIntf = GpuInterface();
    MASSERT(pGpuIntf);

    Wir miscWir =
    {
        "UNLOCK_HAR_FUSE_SEQ", WirT::MISC, instr, RegT::Write, wdrLength,
        SupportedHbmModels(
            { SpecVersion::V2e },
            { Vendor::Micron },
            { Die::Unknown },
            { StackHeight::All },
            { Revision::Unknown }
        )
    };

    CHECK_RC(pGpuIntf->WirWriteRaw(miscWir, hbmSite,
            hbmChannel));
    CHECK_RC(pGpuIntf->ModeWriteRaw(miscWir, hbmSite));
    CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite,
            hbmChannel,
            WdrData({ data })));

    return rc;
}

/******************************************************************************/
// ProcessMbistSummary

RC Hbm::MicronHbm2e::ProcessMbistSummary
(
    const Site &hbmSite
) const
{
    RC rc;
    GpuHbmInterface* pGpuIntf = GpuInterface();
    MASSERT(pGpuIntf);

    // Below logic will read MBIST_SUMMARY channel wise from 0 to 7. i.e. 8 channels
    for (UINT08 channel = 0; channel < s_NumChannels; channel++)
    {
        UINT32 data = 0;
        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001082 | channel << 8));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x00000000));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0x00000000));

        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001F90));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x0000000C));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, data));
        Printf(Tee::PriDebug, "MBIST_SUMMARY value 0x%X for channel %d\n",
               data, channel);
        data = data & 0xFFF;    // Mask out only 12 LSBs
        while (data != 0)
        {
            UINT08 dwordSummary = (data & 0x7);   // Check for LSB 3 bits
            /*
             * ECM : Error Catch Memory
             * For Each of the 3 bits
             * 000 = 0 Fails in ECM (PASS)
             * 001 = 1 Fail in ECM
             * 010 = 2 Fails in ECM
             * 011 = 3 Fails in ECM
             * 100 = 4 Fails in ECM
             * 101 = 5 or more fails in ECM (ECM Overflow)
             * 110 = Massive Fails, unrepairable
             * 111 = Reserved
             */
            // If value is more than 0x6(110 case) then we presume that it is unrepairable
            if (dwordSummary >= 0x6)
            {
                Printf(Tee::PriError, "Massive Failures are detected for site %d,"
                        " This part is unrepairable. Try with Floorsweeping site\n",
                        hbmSite.Number());
                return RC::HBM_REPAIR_IMPOSSIBLE;
            }
            data = data >> 3;
        }
        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001F90));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x0000000C));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0x00000000));
    }
    return rc;
}

/******************************************************************************/
// ProcessMbistRepairVector

RC Hbm::MicronHbm2e::ProcessMbistRepairVector
(
    const Site &hbmSite,
    SiteRowErrorMap *pSiteRowErrorMap
) const
{
    MASSERT(pSiteRowErrorMap);
    RC rc;
    StickyRC firstRc;
    GpuHbmInterface* pGpuIntf = GpuInterface();
    MASSERT(pGpuIntf);

    for (UINT08 channel = 0; channel < s_NumChannels; channel++)
    {
        // Shift 8 bit for channel bits
        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001082 | channel << 8));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x00000000));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0x00000000));

        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001F91));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x00000180));

        Printf(Tee::PriDebug, "MBIST_REPAIR_VECTOR for site %d channel %d\n",
                hbmSite.Number(),  channel);
        MbistRepairVector repairVector;
        for (UINT32 dataIdx = 0; dataIdx < MBIST_REPAIR_VECTOR_REG_SIZE; dataIdx++)
        {
            CHECK_RC(pGpuIntf->WdrReadRaw(hbmSite, &repairVector.data[dataIdx]));
            Printf(Tee::PriDebug, "Repair Vector Data : 0x%X\n", repairVector.data[dataIdx]);
            if (repairVector.dwordInfo[dataIdx].failStatus)
            {
                // Check if entire site has gone bad or no more free resources
                if (repairVector.dwordInfo[dataIdx].repairStatus)
                    return RC::HBM_REPAIR_IMPOSSIBLE;

                HwFbio hwFbio;
                HwFbpa hwFbpa;
                FbpaSubp fbpaSubp;

                CHECK_RC(GpuInterface()->HbmSiteChannelToHwFbpaSubp(hbmSite,
                        HbmChannel(channel),
                        &hwFbpa,
                        &fbpaSubp));
                hwFbio = HwFbio(hwFbpa.Number());   // There is 1:1 corelation between FBP and FB

                RowError rowError = {};
                PseudoChannel pseudoChannel(repairVector.dwordInfo[dataIdx].failingDword >> 1);
                string rowName = std::to_string(hwFbpa.Number()) +
                        "-" + std::to_string(hwFbio.Number()) +
                        "-" + std::to_string(fbpaSubp.Number()) +
                        "-" + std::to_string(pseudoChannel.Number()) +
                        "-" +
                        std::to_string(repairVector.dwordInfo[dataIdx].sid) +
                        "-" +
                        std::to_string(repairVector.dwordInfo[dataIdx].ba) +
                        "-" +
                        std::to_string(repairVector.dwordInfo[dataIdx].ra);

                /* Below code is useful to allow user for run MBIST and perform repairs
                 * Lwrrently this feature is not supported hence kept code for future */
                rowError.row = Row(rowName, hwFbpa, fbpaSubp, pseudoChannel,
                        Rank(repairVector.dwordInfo[dataIdx].sid),
                        Bank(repairVector.dwordInfo[dataIdx].ba),
                        repairVector.dwordInfo[dataIdx].ra);
                rowError.originTestId = 0;  // TODO Need to define test ID for MBIST

                Printf(Tee::PriDebug, "Failing row :%s\n", rowName.c_str());

                (*pSiteRowErrorMap)[hbmSite].push_back({ rowError, HbmChannel(channel) });

                GpuHbmInterface* pGpuIntf = GpuInterface();
                MASSERT(pGpuIntf);
                GpuSubdevice* pSubdev = pGpuIntf->GetGpuSubdevice();
                MASSERT(pSubdev);
                FrameBuffer* pFb = pSubdev->GetFB();
                MASSERT(pFb);
                CHECK_RC(pFb->DumpMBISTFailingPage(hbmSite.Number(), rowName,
                        hwFbio.Number(), fbpaSubp.Number(),
                        repairVector.dwordInfo[dataIdx].sid,
                        repairVector.dwordInfo[dataIdx].ba,
                        repairVector.dwordInfo[dataIdx].ra,
                        pseudoChannel.Number()));

                Printf(Tee::PriDebug, "\n");
                firstRc = RC::HBM_BAD_ROWS_FOUND;
            }
        }
        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001F91));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x00000180));
        for (UINT32 dataIdx = 0; dataIdx < MBIST_REPAIR_VECTOR_REG_SIZE; dataIdx++)
        {
            CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0x0));
        }
    }
    CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001882));
    CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x0));
    CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0x0));
    return firstRc;
}

