        CHECK_RC(pGpuIntf->WirWriteRaw(hbmSite, 0x00001012));
        CHECK_RC(pGpuIntf->ModeWriteRaw(hbmSite, 0x00000048));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0xFFFFFFFF));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0xFFFFFFFF));
        CHECK_RC(pGpuIntf->WdrWriteRaw(hbmSite, 0x000000FF));
